import CountUI from '../../Component/Count'
import {connect} from "react-redux";
import {incrementAction,decrementAction,incrementAsyncAction} from "../../redux/count_action";

function mapStateToProps(state) {
    return{count:state }
}
function mapDispatchToProps(dispatch) {
    return {
        increment:(data)=>{dispatch(incrementAction(data))},
        decrement:(data)=>{dispatch(decrementAction(data))},
        incrementAsync:(data)=>{dispatch(incrementAsyncAction(data,1000))},
    }
}
export default connect(mapStateToProps,mapDispatchToProps)(CountUI)
